var initSablejs = function() {
    if (window.sablejs == null) {
        setTimeout(initSablejs, 100);
    }
    var T = new (window.sablejs()), J = T.getGlobal();
    for (let M in window) {
        const y = window[M];
        "string" != typeof y && "number" != typeof y || T.setProperty(J, M, T.createString(y))
    }
    var I = T.createFunction("log", function() {
        window.newlinks = T.asString(arguments[0]).split("@@@")
    });
    T.setProperty(J, "log", I)
    T.run("")
}
setTimeout(initSablejs, 100);